import React, { Component } from 'react';

class Table extends Component {
  state = {
      button: 1
  }

  render() {
    return (
      <div className="table">
        <div className="players">
        </div>
        <div className="felt">
        </div>
        <div className="buttons">
          <button className="action-button action-fold">Fold</button>
          <button className="action-button action-call">{1}</button>
          <button className="action-button action-raise">Raise</button>
        </div>
      </div>
    );
  }
}

export default Table;
